Head (
Figs. 21–23
): vertex, temples and upper frons very finely coriaceous-punctate, setae short and very fine; occipital carina complete, finely crenulate medially but with only a few fine punctures in genal region; cheeks with dense, fine setigerous punctures, striation weak but strongest basally near mandibular articulation; striation of lower face most pronounced in malar region and on clypeus; central carina of frons very weak, fine, sometimes incomplete; frons with smooth shallow depression on side for reception of scape, without swelling by inner orbits, head not browed in dorsal view; A 1 4.0– 4.3 times longer than wide; A 2 2.4–3.4 times longer than wide; A 3 4.2 –5.0 times longer than A 2 ; flagellum not conspicuously bristly, with few erect setae, setae mostly appressed and short, less than half width of A 3 ; claval formula A 5–12 / 1-2 - 2 - 2 - 2 - 2 - 2 - 1 .

Mesosoma (
Figs. 22–23
): dorsal pronotum with transverse pronotal carina bowed in front of anterior margin of mesoscutum, epomial corners distinct but not raised or sharp; pronotal shoulders broad, at maximum width 0.75 times as wide as tegulae; vertical epomial carina absent; lateral pronotum with small narrow glabrous area medially; netrion punctulate, with short, fine, semi-appressed setae posteriorly directed; mesoscutum with dense, fine setulose punctures; admedian lines always clearly defined, long, 3.0– 4.4 times longer than separation of posterior ends; notaulus complete, finely crenulate, strongest posteriorly, becoming weaker and less distinct anteriorly, subparallel and diverging only slightly anteriorly, ending before epomial corners; parapsidal line clearly indicated; scutellum virtually not bilobate, without spines; mesopleural carina absent; anterior margin and mesepisternum below depression with dense setigerous punctulae, setae very fine, whitish, appressed and obliquely posteroventrally directed; mesopleural depression and area above entirely smooth and almost glabrous; upper half of metapleuron largely smooth and glabrous, lower half not distinctly swollen, densely finely punctulate and hairy like lower mesopleuron; medial excavation of propodeum smooth, flanked by carinae raised anteriorly to sharp tooth-like spine bearing long erect setae; fore wing hyaline, without infuscation under marginal vein between bulla and stigmal vein; stigmal vein distinctly curved basad; postmarginal vein long, 4.0–5.0 times longer than marginal vein, becoming indistinct gradually.
